import React from 'react';

const Home = () => {
  return (
    <body>
      <div className='home-container'>
        <div className='home-section'>
            <h4>Hello There ,</h4>
            <h5>We are creating amazing websites and mobile applications!</h5>
            <h6>I hope so, we can help you!</h6>
        </div>
      </div>
    </body>
  );
};

export default Home;
